Стас, интересует опытный взгляд. Если нужен определенный набор исполняемых методов, то в каких случаях лучше создавать абстрактный класс со статическими методами и каждый раз вызывать их по имени класса, а в каких - создавать обычный класс, создавать его инстанс и вызывать методы инстанса? Примеры:
```public abstract class Djinni {
    public static void doMagic() {...}
    public static Wish askFor(String s) {...}
}```

или

```public class Djinni {
    public void doMagic() {...}
    public Wish askFor(String s) {...}
}```
